My Friend's Hot Mom - June Summers
Added: October 21, 2014

Mrs. Summers is flirtatious. She gets lonely in her big house. Since her son is still at college, she welcomes his friend Derrick when he mistakenly shows up at the house. They get to talking and then some! Flirting with danger is as close as flirting with his friend's mom
